Воспоминания биржевого спекулянта" - художественная биография, пожалуй, одного из самых величайших в истории финансовых гениев, Джесси Ливермора, рассказывающая всю правду о психологии рынков, инвестиций и биржевой игры. В своей книге Эдвин Лефевр:

описывает большое количество трейдовых стратегий, приемов и уловок, которые использовал легендарный Джесси Ливермор;

делится бесценным опытом, полученным его героем;

выдает множество интересных фактов из мира финансов и жизни знаменитого маклера.

На этой классической книге, впервые изданной в 1923 году, выросло уже не одно поколение блестящих финансистов. Благодаря своему гениальному содержанию сегодня "Воспоминания биржевого спекулянта", как и почти век назад, остаются актуальным руководством для трейдеров.

Алгоритмы курса "Без правил" Школы грамотности Романовых теперь в удобном для понимания и запоминания формате мнемокарточек!

Мнемокарточки "Идеальная грамотность. Без правил и зубрежки" :

-позволят избежать наиболее типичных системных ошибок, которые допускают как учащиеся, так и взрослые;

-помогут начать писать грамотно, не тратя время на заучивание правил;

-содержат скрытые и явные мнемонические приемы, способствующие осознанному усвоению алгоритмов, которые разработала филолог и нейрофизиолог Наталья Романова и проиллюстрировал панк-художник Псевдоним.

